import React, { useState } from 'react';
import axios from 'axios';

const UpdatePatient = () => {
    const [phoneNo, setPhoneNo] = useState('');
    const [patientData, setPatientData] = useState({
        name: '',
        age: '',
        gender: '',
        email: '',
        address: ''
    });
    const [message, setMessage] = useState('');
    const [isPatientFound, setIsPatientFound] = useState(false);

    // Handle input changes
    const handleChange = (e) => {
        const { name, value } = e.target;
        setPatientData({ ...patientData, [name]: value });
    };

    // Fetch patient data based on phone number
    const searchPatient = async () => {
        try {
            const response = await axios.get(`http://localhost:3001/search-patient/${phoneNo}`);
            setPatientData(response.data.patient);
            setIsPatientFound(true);
            setMessage('');
        } catch (err) {
            setMessage('Patient not found');
            setIsPatientFound(false);
            setPatientData({
                name: '',
                age: '',
                gender: '',
                email: '',
                address: ''
            });
        }
    };

    // Update patient data
    const updatePatient = async () => {
        if (!isPatientFound) {
            setMessage('Patient not found. Please search first.');
            return;
        }

        try {
            const response = await axios.put('http://localhost:3001/update-patient', {
                phoneNo,
                ...patientData
            });
            setMessage(response.data.message);
        } catch (err) {
            setMessage('Error updating patient.');
        }
    };

    return (
        <div className="container mx-auto p-4">
            <h2 className="text-2xl font-semibold mb-4">Update Patient</h2>

            <div className="mb-4">
                <input
                    type="text"
                    placeholder="Enter phone number"
                    value={phoneNo}
                    onChange={(e) => setPhoneNo(e.target.value)}
                    className="p-2 border border-gray-300 rounded-lg w-full mb-2"
                />
                <button
                    onClick={searchPatient}
                    className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600"
                >
                    Search
                </button>
            </div>

            {message && <div className="text-red-500 mb-4">{message}</div>}

            {isPatientFound && (
                <div className="space-y-4">
                    <form className="space-y-4">
                        <div>
                            <label className="block text-lg font-medium">Name</label>
                            <input
                                type="text"
                                name="name"
                                value={patientData.name}
                                onChange={handleChange}
                                className="p-2 border border-gray-300 rounded-lg w-full"
                            />
                        </div>
                        <div>
                            <label className="block text-lg font-medium">Age</label>
                            <input
                                type="number"
                                name="age"
                                value={patientData.age}
                                onChange={handleChange}
                                className="p-2 border border-gray-300 rounded-lg w-full"
                            />
                        </div>
                        <div>
                            <label className="block text-lg font-medium">Gender</label>
                            <input
                                type="text"
                                name="gender"
                                value={patientData.gender}
                                onChange={handleChange}
                                className="p-2 border border-gray-300 rounded-lg w-full"
                            />
                        </div>
                        <div>
                            <label className="block text-lg font-medium">Email</label>
                            <input
                                type="email"
                                name="email"
                                value={patientData.email}
                                onChange={handleChange}
                                className="p-2 border border-gray-300 rounded-lg w-full"
                            />
                        </div>
                        <div>
                            <label className="block text-lg font-medium">Address</label>
                            <input
                                type="text"
                                name="address"
                                value={patientData.address}
                                onChange={handleChange}
                                className="p-2 border border-gray-300 rounded-lg w-full"
                            />
                        </div>
                        <button
                            type="button"
                            onClick={updatePatient}
                            className="bg-green-500 text-white px-4 py-2 rounded-lg hover:bg-green-600"
                        >
                            Update
                        </button>
                    </form>
                </div>
            )}
        </div>
    );
};

export default UpdatePatient;
